const ListBuild = () => {
    const BuildWith = [
        {
            id: 1, data: [
                { no: 1, title: 'Laravel' }
            ]
        }
    ]
    console.log(BuildWith)
    return (
        <div className="flex pt-2 pl-3 text-gray-400">
            <div className="pt-[2px]">
            <ion-icon name="checkmark-circle-outline"></ion-icon>
            </div>
            <div className="pl-2 text-md">Laravel</div>
        </div>
    )
}
export default ListBuild
